class Stack(object):    def __init__(self):        self.stack = []    def pop(self):        if len(self.stack) < 1:            return None        return self.stack.pop()    def push(self, item):        self.stack.append(item)    def size(self):        return len(self.stack)_stack = Stack()_stack.push(3)_stack.push(1)_stack.push(5)_stack.push(9)_stack.push(6)print(_stack.size())_stack.pop()print(_stack.size())